import React from 'react';

function LaunchCard({ launch }) {
  return (
    <div className="launch-card">
      <h2>{launch.name}</h2>
      <p>Date: {new Date(launch.date_utc).toLocaleDateString()}</p>
      <p>Rocket ID: {launch.rocket}</p>
      <hr />
    </div>
  );
}

export default LaunchCard;
